                    ");
            WriteLiteral(@"</div>
                </div>
                <div class=""col-lg-6 animation"" data-animation=""fadeInUp"" data-animation-delay=""0.3s"">
                    <div class=""about_section pl-lg-3"">
                        <div class=""heading_s1"">
                            <h4><span class=""sub_heading"">Our Product</span></h4>
                            <h6>Our eight month mentoring program runs from October to June</h6>
                        </div>
                        <p>
                            We are a school-based Teen Mentoring Program serving minority and immigrant teens in DeKalb County. 
                            Through Partnerships with high schools we mentor teens ages 15-20.
                            We provide both virtual and in person, and one on-one and group mentoring sessions. Each teen in our program 
                            participates in our four initiatives: Wellness, Education, Employment, and financial literacy, giving them access to
                            ");
            WriteLiteral(@"four different mentors throughout the program year. These experiences provide needful guidance and skills for the transition to adulthood.
                        </p>                      
