                    </div>
                    <p class=""text-white leads"">46 million young people, aged 8-18 live in America today and 16 million of them are growing up without a mentor. 9 million of those without a mentor face a variety of day-to-day challenges that put them at-risk for falling off track. Mentoring is important, not only because of the knowledge and skills mentees learn from mentors, mentoring also provides professional socialization and personal support to facilitate success in adolescent years and beyond. Quality mentoring greatly enhances a teen’s chance for success.</p>
                    
